import React, { Component } from 'react';
import TicketService from '../services/TicketService';

class TicketByIdComponent extends Component {

    constructor(props){
        super(props)
        this.state = {
            id: '',
            ticket: ''
        }

        this.changeIdHandler = this.changeIdHandler.bind(this);
    }

    changeIdHandler = (event) =>{
        this.setState({id: event.target.value})
    }



    submitID = (e) => {
        e.preventDefault();
        TicketService.getTicketsByID(this.state.id).then(res => {
                return(
                <div>
                    <h2 className="text-centre"> Tickets</h2>
                    
                        <div className = "row"> 
                            <table className ="table table-striped table-bordered" >
                                <thead> 
                                    <tr>
                                        <th>id </th>
                                        <th>author </th>
                                        <th>description </th>
                                        <th>title </th>
                                        <th>status </th>
                                    </tr>
                                </thead>
        
                                <tbody>
                                    {
                                        this.state.tickets.map(
                                            tickets =>
                                            <tr key = {tickets.id}>
                                                <td>{tickets.id}</td>
                                                <td>{tickets.author}</td>
                                                <td>{tickets.description}</td>
                                                <td>{tickets.title}</td>
                                                <td>{tickets.status}</td>
                                            </tr>
                                        )
                                    }
                                </tbody>
        
                            </table>
                        </div>
                </div>
                )
            }
        );
        
        
    }
    
    render() {
        return (
                <div className = "container">
                    <div className = "row">
                        <form>
                            <div className="form-group">
                             <div className = "form-group">
                                   <label> id</label>
                                   <input placeholder= "id" name="id" className="form-control" value={this.state.id} onChange={this.changeidHandler}/>
                                </div>
                             <button className="btn btn-success" onClick={this.submitID}>submit</button>
                             </div>
                         </form>
                    </div>
                </div>         
             
        )
    }
            
}

export default TicketByIdComponent;
